import Header from './components/Header/Header';
import NavBar from './components/Header/NavBar';
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">
          <Header/>
          <Routes>
            <Route path='/' element={<NavBar/>}></Route>
          </Routes>

      </div>

    </Router>

  );
}

export default App;
